import React, { Component } from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import Main from './components/main';
import { Link } from 'react-router-dom';



class App extends Component {
  render() {
    return (
      <div style={{height: '400px', position: 'relative'}}>

    <Layout style={{background: 'url(background2.png) center / cover'}}>     
        <Header transparent title={<Link to="/">
                <img
                  alt="logo"
                  src="RuLogo.png" 
                  height="70px" 
                  width="170"
                />
                </Link>} style={{margin: 'none', color: 'black'}}
          scroll>
        </Header>
        <Drawer title={<Link style={{textDecoration: 'none', color: 'black'}} to="/">Rusilah's Portfolio</Link>}>
            <Navigation>
              <Link to="/aboutme">About Me</Link>
              <Link to="/resume">Resume</Link>
              <Link to="/projects">Projects</Link>
              <Link to="/blog">Blog</Link>
              <Link to="/contact">Contact</Link>
            </Navigation>
        </Drawer>
        <Content>
            <div className="page-content" />
            <Main/>
        </Content>
    </Layout>
</div>

    );
  }
}

export default App;
